const Project1 = () => {
  return (
    <div className="container mx-auto mt-8">
      <div className="box">
      <img src="./images/p1.jpeg" alt="Sample Image" className="w-full" />
      <div className="box-text">
        <h2 className="text-xl font-bold mb-2">Box Title</h2>
        <p>This is some sample text inside the box.</p>
      </div>
    </div>
    </div>
  );
};

export default Project1;
